import { StyleSheet, Text, View, ScrollView } from "react-native";
import TodoItem from "./TodoItem";
import React from "react";

const TodoList = ({ todos, onRemove }) => {
  return (
    <ScrollView>
      <TodoItem />
    </ScrollView>
  );
};

export default TodoList;
